CREATE PROCEDURE [SONDA].[SONDA_SP_INSERT_SALES_ORDERS_REQUESTED_FROM_SWIFT] (@XML XML)
AS
BEGIN
  SET NOCOUNT ON;
  --
  DECLARE @HEADER TABLE (
    [SALES_ORDER_ID] INT
   ,[POSTED_DATETIME] DATETIME
   ,[CLIENT_ID] VARCHAR(50)
   ,[POS_TERMINAL] VARCHAR(25)
