   ,[DISCOUNT] NUMERIC(18, 6)
   ,[IS_DRAFT] INT
   ,[ASSIGNED_BY] VARCHAR(50)
   ,[TASK_ID] INT
   ,[COMMENT] VARCHAR(250)
   ,[PAYMENT_TIMES_PRINTED] INT
   ,[PAID_TO_DATE] NUMERIC(18, 6)
   ,[TO_BILL] INT
   ,[HAVE_PICKING] INT
   ,[DISCOUNT_BY_GENERAL_AMOUNT] NUMERIC(18, 6)
   ,[SERVER_POSTED_DATETIME] DATETIME
   ,[DEVICE_NETWORK_TYPE] VARCHAR(15)
   ,[IS_POSTED] INT
   ,[IS_POSTED_OFFLINE] INT
  );

  DECLARE @DETAIL TABLE (
    [SALES_ORDER_ID] INT
   ,[SKU] [VARCHAR](25) NOT NULL
   ,[LINE_SEQ] [INT] NOT NULL
   ,[QTY] [NUMERIC](18, 2) NULL
   ,[PRICE] [MONEY] NULL
   ,[DISCOUNT] [MONEY] NULL
   ,[TOTAL_LINE] [MONEY] NULL
   ,[POSTED_DATETIME] [DATETIME] NULL
   ,[SERIE] [VARCHAR](50) NULL
   ,[SERIE_2] [VARCHAR](50) NULL
   ,[REQUERIES_SERIE] [INT] NULL
   ,[COMBO_REFERENCE] [VARCHAR](50) NULL
   ,[IS_ACTIVE_ROUTE] [INT] NULL
   ,[CODE_PACK_UNIT] [VARCHAR](50) NULL
