   ,[INTERFACE_OWNER] [VARCHAR](50)
   ,[DOC_SERIE] VARCHAR(100)
   ,[DOC_NUM] INT
  );
  --
  DECLARE @ID INT
         ,@SALES_ORDER_ID INT
         ,@DOC_SERIE VARCHAR(100)
         ,@DOC_NUM INT
         ,@INSERT_ERROR VARCHAR(MAX)
         ,@LOG_MESSAGE VARCHAR(MAX)
