  --
  BEGIN TRY
    -- ------------------------------------------------------------------------------------
    -- Obtiene los datos generales
    -- ------------------------------------------------------------------------------------
    SELECT
      @CODE_ROUTE = [x].[Rec].[query]('./routeid').[value]('.',
      'varchar(50)')
    FROM @XML.[nodes]('/Data') AS [x] ([Rec]);

    -- ------------------------------------------------------------------------------------
    -- Obtiene los encabezados
    -- ------------------------------------------------------------------------------------
    INSERT INTO @HEADER ([SALES_ORDER_ID]
    , [POSTED_DATETIME]
    , [CLIENT_ID]
    , [POS_TERMINAL]
    , [GPS_URL]
