    , [DEVICE_BATTERY_FACTOR]
    , [VOID_DATETIME]
    , [VOID_REASON]
    , [VOID_NOTES]
    , [VOIDED]
    , [CLOSED_ROUTE_DATETIME]
    , [GPS_EXPECTED]
    , [DELIVERY_DATE]
    , [SALES_ORDER_ID_HH]
    , [IS_PARENT]
    , [REFERENCE_ID]
    , [TIMES_PRINTED]
    , [DOC_SERIE]
    , [DOC_NUM]
    , [IS_VOID]
    , [SALES_ORDER_TYPE]
    , [DISCOUNT]
    , [IS_DRAFT]
    , [TASK_ID]
    , [COMMENT]
    , [PAYMENT_TIMES_PRINTED]
    , [PAID_TO_DATE]
    , [TO_BILL]
    , [DISCOUNT_BY_GENERAL_AMOUNT]
    , [SERVER_POSTED_DATETIME]
    , [DEVICE_NETWORK_TYPE]
    , [IS_POSTED]
    , [IS_POSTED_OFFLINE])
      SELECT
        CASE [x].[Rec].[query]('./SALES_ORDER_ID').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./SALES_ORDER_ID').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./POSTED_DATETIME').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./POSTED_DATETIME').[value]('.', 'datetime')
        END
       ,[x].[Rec].[query]('./CLIENT_ID').[value]('.', 'varchar(50)')
       ,[x].[Rec].[query]('./POS_TERMINAL').[value]('.', 'varchar(25)')
       ,[x].[Rec].[query]('./GPS_URL').[value]('.', 'varchar(150)')
       ,CASE [x].[Rec].[query]('./TOTAL_AMOUNT').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./TOTAL_AMOUNT').[value]('.', 'money')
        END
       ,CASE [x].[Rec].[query]('./STATUS').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./STATUS').[value]('.', 'int')
        END
       ,[x].[Rec].[query]('./POSTED_BY').[value]('.', 'varchar(25)')
       ,CASE [x].[Rec].[query]('./IMAGE_1').[value]('.', 'varchar(max)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IMAGE_1').[value]('.', 'varchar(max)')
        END
       ,CASE [x].[Rec].[query]('./IMAGE_2').[value]('.', 'varchar(max)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IMAGE_2').[value]('.', 'varchar(max)')
        END
       ,CASE [x].[Rec].[query]('./IMAGE_3').[value]('.', 'varchar(max)')
          WHEN 'null' THEN NULL
