       ,CASE [x].[Rec].[query]('./VOID_DATETIME').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./VOID_DATETIME').[value]('.', 'DATETIME')
        END
       ,CASE [x].[Rec].[query]('./VOID_REASON').[value]('.', 'varchar(25)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./VOID_REASON').[value]('.', 'varchar(25)')
        END
       ,CASE [x].[Rec].[query]('./VOID_NOTES').[value]('.', 'varchar(MAX)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./VOID_NOTES').[value]('.', 'varchar(MAX)')
        END
       ,CASE [x].[Rec].[query]('./VOIDED').[value]('.', 'varchar(25)')
          WHEN 'null' THEN NULL
