       ,CASE [x].[Rec].[query]('./CLOSED_ROUTE_DATETIME').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./CLOSED_ROUTE_DATETIME').[value]('.', 'DATETIME')
        END
       ,[x].[Rec].[query]('./GPS_EXPECTED').[value]('.', 'varchar(max)')
       ,CASE [x].[Rec].[query]('./DELIVERY_DATE').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./DELIVERY_DATE').[value]('.', 'DATETIME')
        END
       ,CASE [x].[Rec].[query]('./SALES_ORDER_ID').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./SALES_ORDER_ID').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./IS_PARENT').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IS_PARENT').[value]('.', 'int')
        END
       ,[x].[Rec].[query]('./REFERENCE_ID').[value]('.', 'varchar(150)')
       ,CASE [x].[Rec].[query]('./TIMES_PRINTED').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./TIMES_PRINTED').[value]('.', 'int')
        END
       ,[x].[Rec].[query]('./DOC_SERIE').[value]('.', 'varchar(100)')
       ,CASE [x].[Rec].[query]('./DOC_NUM').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./DOC_NUM').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./IS_VOID').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IS_VOID').[value]('.', 'int')
        END
       ,[x].[Rec].[query]('./SALES_ORDER_TYPE').[value]('.', 'varchar(250)')
       ,CASE [x].[Rec].[query]('./DISCOUNT').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./DISCOUNT').[value]('.', 'numeric(18,6)')
        END
       ,CASE [x].[Rec].[query]('./IS_DRAFT').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IS_DRAFT').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./TASK_ID').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./TASK_ID').[value]('.', 'int')
        END
       ,[x].[Rec].[query]('./COMMENT').[value]('.', 'varchar(250)')
       ,CASE [x].[Rec].[query]('./PAYMENT_TIMES_PRINTED').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./PAYMENT_TIMES_PRINTED').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./PAID_TO_DATE').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./PAID_TO_DATE').[value]('.', 'numeric(18,6)')
        END
       ,CASE [x].[Rec].[query]('./TO_BILL').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./TO_BILL').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./DISCOUNT_BY_GENERAL_AMOUNT').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./DISCOUNT_BY_GENERAL_AMOUNT').[value]('.', 'numeric(18,6)')
        END
       ,CASE [x].[Rec].[query]('./SERVER_POSTED_DATETIME').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./SERVER_POSTED_DATETIME').[value]('.', 'DATETIME')
        END
       ,[x].[Rec].[query]('./DEVICE_NETWORK_TYPE').[value]('.', 'varchar(25)')
       ,CASE [x].[Rec].[query]('./IS_POSTED').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IS_POSTED').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./IS_POSTED_OFFLINE').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IS_POSTED_OFFLINE').[value]('.', 'int')
        END
      FROM @XML.[nodes]('/Data/salesOrders') AS [x] ([Rec]);

    -- ------------------------------------------------------------------------------------
    -- Obtiene los detalles
    -- ------------------------------------------------------------------------------------
    INSERT INTO @DETAIL ([SALES_ORDER_ID]
    , [SKU]
    , [LINE_SEQ]
    , [QTY]
    , [PRICE]
    , [DISCOUNT]
    , [TOTAL_LINE]
    , [POSTED_DATETIME]
    , [SERIE]
    , [SERIE_2]
    , [REQUERIES_SERIE]
    , [COMBO_REFERENCE]
    , [IS_ACTIVE_ROUTE]
    , [CODE_PACK_UNIT]
    , [IS_BONUS]
    , [LONG]
    , [INTERFACE_OWNER]
    , [DOC_SERIE]
    , [DOC_NUM])
      SELECT
        CASE [x].[Rec].[query]('./SALES_ORDER_ID').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./SALES_ORDER_ID').[value]('.', 'int')
        END
       ,[x].[Rec].[query]('./SKU').[value]('.', 'varchar(50)')
       ,CASE [x].[Rec].[query]('./LINE_SEQ').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./LINE_SEQ').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./QTY').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./QTY').[value]('.', 'int')
        END
       ,CASE [x].[Rec].[query]('./PRICE').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./PRICE').[value]('.', 'money')
        END
       ,CASE [x].[Rec].[query]('./DISCOUNT').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./DISCOUNT').[value]('.', 'money')
        END
       ,CASE [x].[Rec].[query]('./TOTAL_LINE').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./TOTAL_LINE').[value]('.', 'money')
        END
       ,CASE [x].[Rec].[query]('./POSTED_DATETIME').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./POSTED_DATETIME').[value]('.', 'datetime')
        END
       ,[x].[Rec].[query]('./SERIE').[value]('.', 'varchar(50)')
       ,[x].[Rec].[query]('./SERIE_2').[value]('.', 'varchar(50)')
       ,CASE [x].[Rec].[query]('./REQUERIES_SERIE').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./REQUERIES_SERIE').[value]('.', 'int')
        END
       ,[x].[Rec].[query]('./COMBO_REFERENCE').[value]('.', 'varchar(50)')
       ,CASE [x].[Rec].[query]('./IS_ACTIVE_ROUTE').[value]('.', 'varchar(50)')
          WHEN 'null' THEN NULL
          ELSE [x].[Rec].[query]('./IS_ACTIVE_ROUTE').[value]('.', 'int')
        END
