      -- --------------------------------------------------------------------------------
      -- SE OBTIENE ORDEN DE VENTA A PROCESAR
      -- --------------------------------------------------------------------------------
      SELECT TOP 1
        @SALES_ORDER_ID = [SOH].[SALES_ORDER_ID]
       ,@DOC_SERIE = [SOH].[DOC_SERIE]
       ,@DOC_NUM = [SOH].[DOC_NUM]
      FROM @HEADER AS [SOH];

    -------------------------------------------------------------------------------
    -- SE INSERTA LA ORDEN DE VENTA
    -- -------------------------------------------------------------------------------
    BEGIN TRY
      --
      BEGIN TRAN;
      -- ------------------------------------------------------------------------------------
      -- Inserta el encabezado
      -- ------------------------------------------------------------------------------------
      INSERT INTO [SONDA].[SONDA_SALES_ORDER_HEADER_REQUESTED] ([SALES_ORDER_ID]
      , [POSTED_DATETIME]
      , [CLIENT_ID]
      , [POS_TERMINAL]
      , [GPS_URL]
      , [TOTAL_AMOUNT]
      , [STATUS]
      , [POSTED_BY]
      , [IMAGE_1]
      , [IMAGE_2]
      , [IMAGE_3]
      , [DEVICE_BATTERY_FACTOR]
      , [VOID_DATETIME]
      , [VOID_REASON]
      , [VOID_NOTES]
      , [VOIDED]
      , [CLOSED_ROUTE_DATETIME]
      , [IS_ACTIVE_ROUTE]
      , [GPS_EXPECTED]
      , [DELIVERY_DATE]
      , [SALES_ORDER_ID_HH]
      , [IS_PARENT]
      , [REFERENCE_ID]
      , [WAREHOUSE]
      , [TIMES_PRINTED]
      , [DOC_SERIE]
      , [DOC_NUM]
      , [IS_VOID]
      , [SALES_ORDER_TYPE]
      , [DISCOUNT]
      , [IS_DRAFT]
      , [ASSIGNED_BY]
      , [TASK_ID]
      , [COMMENT]
      , [PAYMENT_TIMES_PRINTED]
      , [PAID_TO_DATE]
      , [TO_BILL]
      , [HAVE_PICKING]
      , [DISCOUNT_BY_GENERAL_AMOUNT]
