         ,[SOH].[POSTED_DATETIME]
         ,[SOH].[CLIENT_ID]
         ,[SOH].[POS_TERMINAL]
         ,[SOH].[GPS_URL]
         ,[SOH].[TOTAL_AMOUNT]
         ,[SOH].[STATUS]
         ,[SOH].[POSTED_BY]
         ,[SOH].[IMAGE_1]
         ,[SOH].[IMAGE_2]
         ,[SOH].[IMAGE_3]
         ,[SOH].[DEVICE_BATTERY_FACTOR]
         ,[SOH].[VOID_DATETIME]
         ,[SOH].[VOID_REASON]
         ,[SOH].[VOID_NOTES]
         ,[SOH].[VOIDED]
         ,[SOH].[CLOSED_ROUTE_DATETIME]
         ,[SOH].[IS_ACTIVE_ROUTE]
         ,[SOH].[GPS_EXPECTED]
         ,[SOH].[DELIVERY_DATE]
         ,[SOH].[SALES_ORDER_ID_HH]
         ,[SOH].[IS_PARENT]
         ,[SOH].[REFERENCE_ID]
         ,[SOH].[WAREHOUSE]
         ,[SOH].[TIMES_PRINTED]
         ,[SOH].[DOC_SERIE]
         ,[SOH].[DOC_NUM]
         ,[SOH].[IS_VOID]
         ,[SOH].[SALES_ORDER_TYPE]
         ,[SOH].[DISCOUNT]
         ,[SOH].[IS_DRAFT]
         ,[SOH].[ASSIGNED_BY]
         ,[SOH].[TASK_ID]
         ,[SOH].[COMMENT]
         ,[SOH].[PAYMENT_TIMES_PRINTED]
         ,[SOH].[PAID_TO_DATE]
         ,[SOH].[TO_BILL]
         ,[SOH].[HAVE_PICKING]
         ,[SOH].[DISCOUNT_BY_GENERAL_AMOUNT]
         ,[SOH].[SERVER_POSTED_DATETIME]
         ,[SOH].[IS_POSTED]
         ,[SOH].[IS_POSTED_OFFLINE]
         ,[SOH].[DEVICE_NETWORK_TYPE]
        FROM @HEADER AS [SOH]
        WHERE [SOH].[DOC_SERIE] = @DOC_SERIE
        AND [SOH].[DOC_NUM] = @DOC_NUM;
      --
      SET @ID = SCOPE_IDENTITY();

      -- ------------------------------------------------------------------------------------
      -- inserta el detalle
      -- ------------------------------------------------------------------------------------
      INSERT INTO [SONDA].[SONDA_SALES_ORDER_DETAIL_REQUESTED] ([ORDER_ID]
      , [SALES_ORDER_ID]
      , [SKU]
      , [LINE_SEQ]
      , [QTY]
      , [PRICE]
      , [DISCOUNT]
      , [TOTAL_LINE]
      , [POSTED_DATETIME]
      , [SERIE]
      , [SERIE_2]
      , [REQUERIES_SERIE]
      , [COMBO_REFERENCE]
      , [IS_ACTIVE_ROUTE]
      , [CODE_PACK_UNIT]
      , [IS_BONUS]
      , [LONG]
      , [INTERFACE_OWNER])
        SELECT
          @ID
         ,[D].[SALES_ORDER_ID]
         ,[D].[SKU]
         ,[D].[LINE_SEQ]
         ,[D].[QTY]
         ,[D].[PRICE]
         ,[D].[DISCOUNT]
         ,[D].[TOTAL_LINE]
         ,[D].[POSTED_DATETIME]
         ,[D].[SERIE]
         ,[D].[SERIE_2]
         ,[D].[REQUERIES_SERIE]
         ,[D].[COMBO_REFERENCE]
         ,[D].[IS_ACTIVE_ROUTE]
         ,[D].[CODE_PACK_UNIT]
         ,[D].[IS_BONUS]
         ,[D].[LONG]
         ,[D].[INTERFACE_OWNER]
        FROM @DETAIL [D]
        WHERE [D].[DOC_SERIE] = @DOC_SERIE
        AND [D].[DOC_NUM] = @DOC_NUM;
      --
      COMMIT;

    END TRY
    BEGIN CATCH
      ROLLBACK;
      --
      SET @INSERT_ERROR = ERROR_MESSAGE();
      --
      EXEC [SONDA].[SONDA_SP_INSERT_SONDA_SERVER_ERROR_LOG] @CODE_ROUTE = @CODE_ROUTE
                                                           ,@LOGIN = NULL
                                                           ,@SOURCE_ERROR = 'SONDA_SP_INSERT_SALES_ORDERS_REQUESTED_FROM_SWIFT'
                                                           ,@DOC_RESOLUTION = NULL
                                                           ,@DOC_SERIE = @DOC_SERIE
                                                           ,@DOC_NUM = @DOC_NUM
                                                           ,@MESSAGE_ERROR = @INSERT_ERROR
                                                           ,@SEVERITY_CODE = 10;
      --
      RAISERROR (@INSERT_ERROR, 16, 1);
    END CATCH;

      -- ---------------------------------------------------------------------------------------
      -- Se elimina la orden de venta procesada
      -- ---------------------------------------------------------------------------------------
      DELETE FROM @DETAIL
      WHERE [DOC_SERIE] = @DOC_SERIE
        AND [DOC_NUM] = @DOC_NUM;
      DELETE FROM @HEADER
      WHERE [DOC_SERIE] = @DOC_SERIE
        AND [DOC_NUM] = @DOC_NUM;
    END;

    -- ---------------------------------------------------------------------------------------
    -- Se inserta el log de la obtencion de documentos
    -- ---------------------------------------------------------------------------------------
    SET @LOG_MESSAGE = 'Los documentos de la ruta: ' + @CODE_ROUTE + ' han sido obtenidos exitosamente';

    EXEC [SONDA].[SONDA_SP_INSERT_SONDA_SERVER_ERROR_LOG] @CODE_ROUTE = @CODE_ROUTE
                                                         ,@LOGIN = NULL
                                                         ,@SOURCE_ERROR = 'SONDA_SP_INSERT_SALES_ORDERS_REQUESTED_FROM_SWIFT'
                                                         ,@DOC_RESOLUTION = NULL
                                                         ,@DOC_SERIE = @DOC_SERIE
                                                         ,@DOC_NUM = @DOC_NUM
                                                         ,@MESSAGE_ERROR = @LOG_MESSAGE
                                                         ,@SEVERITY_CODE = -95;

  END TRY
  BEGIN CATCH
    IF XACT_STATE() <> 0
    BEGIN
      ROLLBACK;
    END;
    --
    SET @LOG_MESSAGE = ERROR_MESSAGE();
    --
    EXEC [SONDA].[SONDA_SP_INSERT_SONDA_SERVER_ERROR_LOG] @CODE_ROUTE = @CODE_ROUTE
                                                         ,@LOGIN = NULL
                                                         ,@SOURCE_ERROR = 'SONDA_SP_INSERT_SALES_ORDERS_REQUESTED_FROM_SWIFT'
                                                         ,@DOC_RESOLUTION = NULL
                                                         ,@DOC_SERIE = @DOC_SERIE
                                                         ,@DOC_NUM = @DOC_NUM
                                                         ,@MESSAGE_ERROR = @LOG_MESSAGE
                                                         ,@SEVERITY_CODE = 10;
    --
    RAISERROR (@LOG_MESSAGE, 16, 1);
  END CATCH;
END;
